description:
ISO Image of the game The Last of Us (version BCUS98174), modified to include the 1.06 Patch and the DLC: Left Behind, for the PS3.
To be played on Cobra CFWs (you don't need a dongle to use those anymore).

PS: To play the DLC you must install the 1.06 Patch (included) or a newer version.

For non-cobra CFWs it is possible to convert the file to a game folder with the following tool and play it: &lt;a href=&quot;
